import React, {Component} from 'react';
import './Penroll.css';
import {Link} from 'react-router-dom';

class Penroll extends Component{
    state={
        provider: '',
        name: '',
        tags: '',
        price: '',
        discription : '',
        photo : ''
    }

    handleChange_name=(e)=>{
        this.setState({name : e.target.value})
    }

    handleChange_tags=(e)=>{
        this.setState({tages : e.target.value})
    }

    handleChange_price = (e) =>{
        this.setState({price : e.target.value})
    }

    handleChange_discription = (e) =>{
        this.setState({discription : e.target.value})
    }

    handleChange_photo = (e) =>{
        this.setState({photo : e.target.files})
    }


    onEnroll=()=>{

    }

    onKeyPress=(e)=>{
        if(e.key === 'Enter'){
            this.onEnroll();
        }
    }

    render(){
        const{provider,name,tages,price,discription,photo} = this.state;

        return(
            <div className="info-wrapper">
                <div className="info-box">
                    <div className="order-Right">
                        <div className = "user-info-box">
                        <div className = "order-info-header">상품등록</div>
                        <div className = "user-info-discription">
                            <div className="login-pod">
                                <span className="tag-pod">상품명</span>
                                    <input value={this.state.name} onChange={this.handleChange_name} onKeyPress={this.onKeyPress}/>
                            </div>
                            <div className="login-pod">
                                <span className="tag-pod">가격</span>
                                    <input value={this.state.price} onChange={this.handleChange_price} onKeyPress={this.onKeyPress}/>
                            </div>
                            <div className="login-pod">
                                <span className="tag-pod">상세설명</span>
                                <input value={this.state.discription} onChange={this.handleChange_discription} onKeyPress={this.onKeyPress}/>
                            </div>
                            <div className="login-pod">
                                <span className="tag-pod">태그</span>
                                <input value={this.state.tags} onChange={this.handleChange_tags} onKeyPress={this.onKeyPress}/>
                            </div>
                            <div className="photo-pod">
                                <span className="tag-pod">이미지</span>
                                <input type="img" onChange={this.handleChange_tags}/>
                            </div>
                            <Link to = '/login'>
                                <div className="update-button" onClick={this.onEnroll}>
                                    등록
                                </div>
                            </Link>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Penroll;
